import './App.css';
import GameSelectionScreen from './components/GameSelectionScreen';

const element = document.getElementById('background');
element.classList.add('background-image');

function App() {
  return (
      <div id='background'>
        <GameSelectionScreen />
      </div>
  );
}

export default App;
